import CartItem from "./ca";

const CartDropdown = ({ cart }) => {
  return (
    <div className="cart-dropdown">
      <div className="cart-items">{}</div>
      <CustomButton>CheckOut</CustomButton>
    </div>
  );
};
const fun1 = ({ cart: { cart } }) => ({
  cart,
});

export default connect(fun1)(CartDropdown);
